                    <div style={{ fontWeight: 400, fontSize: '1.1rem' }}>
                        <p>
                            La cultura está presente en todas las facetas de nuestras vidas y nosotros no sólo participamos en la sociedad como consumidores de cultura, sino también como creadores. William Edgar, profesor de apologética en el Seminario de Wetsminster, sostiene que:
                            “la participación cultural es un aspecto fundamental de la existencia humana y que cuando participamos en la creación de cultura es cuando somos más fieles a nuestro llamamiento como criaturas de Dios.”
                        </p>

                        <p>
                            Como seres humanos, <span style={{ fontWeight: '800' }}>fuimos diseñados para ser creadores y constructores de cultura.</span> En Génesis 1:28 dice: “Dios los bendijo, y les dijo: Sean fructíferos y multiplíquense; llenen la tierra y sométanla…”. Con este versículo, Dios ordena a Adán y a Eva dominar la tierra; esta idea de dominio incluye la responsabilidad de cuidar y administrar el mundo creado por Dios, pero también implica una participación activa en la creación y construcción de la sociedad y, por ende, de la cultura.
                        </p>

                        <p>
                            Pero ¿cómo reflejamos a Dios como creadores de cultura? En Génesis 1 vemos a un <span style={{ fontWeight: '800', color: 'white', backgroundColor: '#63B672' }}>Dios creador que fue poniendo orden en medio del caos,</span> separando la luz de las tinieblas, las aguas de las aguas, descubriendo lo seco, etc. Él ejerce un dominio sobre Su creación y lo hace significativo y hermoso. De la misma manera nosotros, como imagen y semejanza de Dios, tenemos un deseo inherente de crear y dar forma a nuestro entorno.
                        </p>

                        <p>
                            <span style={{ fontWeight: '800' }}>Dios encarga al hombre la tarea de ser co-creadores, compartiendo con él la responsabilidad de desarrollar el mundo y la historia.</span> Esta capacidad creativa, refleja la acción misma de Dios como Creador y se manifiesta en diversas áreas de la vida humana, incluyendo lo administrativo, lingüístico, musical, cinematográfico, entre otros.
                        </p>

                        <p>La comunidad cristiana interactúa constantemente con la cultura que los rodea, esta interacción puede influir tanto en la forma en que consumen la cultura, como en la forma en que contribuyen a su creación. Muchos cristianos encuentran inspiración en su fe para crear música, literatura, arte visual y otras formas de expresión cultural que reflejan sus creencias y valores.</p>

                        <p>
                            Al participar en la creación cultural desde una perspectiva bíblica, nos desafiamos a nosotros mismos a ser fieles a nuestro llamado como criaturas de Dios. Esto implica reconocer que <span style={{ fontWeight: '800', backgroundColor: '#008066', color: 'white' }}>somos más que espectadores, somos co-creadores del desarrollo del mundo,</span> llamados a trabajar por el bien común y la gloria de nuestro Creador en cada expresión cultural que creamos y disfrutamos. Elaborando así, prácticas culturales que lo glorifiquen a Él, y que demuestren el amor a nuestro prójimo como así también el cuidado a toda la creación.
                        </p>
                    </div>
